            retval += "\ndef " + dc->getName() + " := \n\tlet var := (⟨⟨" + std::to_string(id) + "⟩⟩ : lang.classicalTime.spaceVar) in\n";
            retval += "\tlet spaceLiteral := lang.classicalTime.spaceExpr.lit(classicalTime.build " + std::to_string(id-1) + ") in\n";
