std::string REAL3_LIT_REAL1_EXPR_REAL1_EXPR_REAL1_EXPR::toDefString() const {
    std::string retval = ""; 
    auto env = getEnvName();
    retval += "def " + this->coords_->toString() + " := expr (" + this->toString() + ")\n";
    retval += "\ndef " + env + " := cmdEval " + this->coords_->toString() + " " + getLastEnv();
    return retval;       
}
                                


