std::string REAL3_EMPTY::toDefString() const {
    std::string retval = ""; 
    auto env = getEnvName();
    retval += "def " + this->coords_->toString() + " := expr (" + this->toString() + ")\n";
    retval += "\ndef " + env + " := cmdEval " + this->coords_->toString() + " " + getLastEnv();
    return retval;       
}
                                

